from faker import *
import random
from db_helpers import *
from scraping_helpers import *
from proxies_scrape import *

"""
Bot to generate fake creds for chaturbate.com

Fake creds include
1. username
2. password
3. email
4. dob
5. gender

#Step 1 
- Generate fake creds

#Step 2
- Save in DB

#Step 3
- Begin registration per DB record

"""

proxies = []
prxy = Proxy()
prxy.process_proxies()
proxies = prxy.proxies
print("proxies")
print(proxies)
print("Generating users")
max_limit = 2

db = DbConn()
data_sets = generate_data(max_limit)

counter = 0
for data_set in data_sets:
	if counter == max_limit:
		break
	db.insert('users', data_set)
	counter += 1

print("Fetching data")
users = db.select("users", True, False)

browser = prxy.get_browser()

proxy_set = []
for prox in proxies:
	for prox_inner in prox['proxies']:
		proxy_set.append({'ip': prox_inner['ip'], 'port': prox_inner['port']})

for user in users:
	browser.close()
	print("Closing existing open window")
	current_proxy = random.choice(proxy_set)
	prxy.set_proxy(current_proxy['ip'], current_proxy['port'])
	browser = prxy.get_browser()
	print("Attempting proxy"+ current_proxy['ip'] + ":" + current_proxy['port'])
	prxy.browse_url(browser, "https://www.whatismyip.net/")
	sleep_script(1)
	continue
	# Web Scraping
	URL_REGISTER = "https://chaturbate.com/accounts/register/"
	# Scraping in case of single user
	prxy.browse_url(browser, URL_REGISTER)
	print("Auto-filling details")

	form_input_text(browser, "input[name=\'username\']", user['username'], True)
	form_input_text(browser, "input[name=\'password\']", user['password'], True)
	form_input_text(browser, "#id_email", user['email'], True)

	dob_set = user['dob'].split('-')
	form_select_option(browser, "select[name=\'birthday_month\']", dob_set[0])
	form_select_option(browser, "select[name=\'birthday_day\']", dob_set[1])
	form_select_option(browser, "select[name=\'birthday_year\']", dob_set[2])

	form_select_option(browser, "select[name=\'gender\']", user['gender'])

	form_select_checkbox(browser, 'id_terms')

	print("Attempting registration...")
	

print("END of Script")
